import React from "react";

const Trow = (props) => {
  return (
    <>
      {props.data.map((investment, index) => (
        <tr key={index}>
          <td>{investment.year}</td>
          <td>{investment.totalSavings}</td>
          <td>{investment.interestInYear}</td>
          <td>{investment.totalInterest}</td>
          <td>{investment.totalInvestedCapital}</td>
        </tr>
      ))}
    </>
  );
};

export default Trow;
